I'll provide a basic example of an Ethereum (ETH) lending and borrowing smart contract written in Solidity. This is for educational purposes, and you should not deploy this to the mainnet without proper testing and security audits.

**EtherLender.sol**
```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EtherLender {
    // Mapping of borrowers to their loan balances
    mapping (address => uint256) public loanBalances;

    // Mapping of lenders to their deposited ETH balance
    mapping (address => uint256) public lenderBalances;

    // Interest rate per year (in percentage)
    uint256 public interestRate = 5; // 5%

    // Loan duration (in days)
    uint256 public loanDuration = 30 days;

    // Event emitted when a loan is taken
    event LoanTaken(address indexed borrower, uint256 amount);

    // Event emitted when a payment is made
    event PaymentMade(address indexed payer, uint256 amount);

    // Event emitted when funds are withdrawn
    event FundsWithdrawn(address indexed withdrawer, uint256 amount);

    // Function to deposit ETH as a lender
    function deposit() public payable {
        require(msg.value > 0, "Insufficient ETH");

        lenderBalances[msg.sender] += msg.value;
    }

    // Function to borrow ETH as a borrower
    function borrow(uint256 _amount) public {
        require(lenderBalances[msg.sender] >= _amount, "Insufficient lender balance");
        require(loanBalances[msg.sender] == 0, "Already have an active loan");

        // Calculate interest
        uint256 interest = (_amount * interestRate / 100) * loanDuration / 365;

        // Update loan balance and emit event
        loanBalances[msg.sender] = _amount + interest;
        emit LoanTaken(msg.sender, _amount);
    }

    // Function to make a payment as a borrower
    function pay(uint256 _amount) public {
        require(loanBalances[msg.sender] > 0, "No outstanding loan balance");
        require(_amount <= loanBalances[msg.sender], "Payment exceeds loan balance");

        // Update loan balance and emit event
        loanBalances[msg.sender] -= _amount;
        emit PaymentMade(msg.sender, _amount);
    }

    // Function to withdraw ETH as a lender or borrower
    function withdraw(uint256 _amount) public {
        require((lenderBalances[msg.sender] >= _amount || loanBalances[msg.sender] >= _amount), "Insufficient balance");
        require(_amount > 0, "Invalid withdrawal amount");

        if (lenderBalances[msg.sender] >= _amount) {
            // Withdraw from lender balance
            lenderBalances[msg.sender] -= _amount;
        } else if (loanBalances[msg.sender] >= _amount) {
            // Withdraw from loan balance
            loanBalances[msg.sender] -= _amount;
        }

        // Transfer ETH
        (bool success, ) = payable(msg.sender).call{value: _amount}("");
        require(success, "Transfer failed");

        emit FundsWithdrawn(msg.sender, _amount);
    }
}
```
Here's a brief overview of how this contract works:

1. **Deposit**: Lenders can deposit ETH by calling the `deposit` function.
2. **Borrow**: Borrowers can take out loans in ETH by calling the `borrow` function, specifying the desired loan amount.
3. **Pay**: Borrowers can repay loans with interest using the `pay` function.
4. **Withdraw**: Lenders and borrowers can withdraw their respective balances using the `withdraw` function.

