In Vue 3 and Nuxt 3, you can set a default value for a prop by using the `withDefaults` compositor function or the `props` define option.

**Method 1: Using `withDefaults` (Vue 3 only)**

In your component, import `withDefaults` from Vue and define your props with a default value like this:
```javascript
import { defineComponent, withDefaults } from 'vue';

export default defineComponent({
  props: {
    title: withDefaults(() => ({
      type: String,
      default: 'Default Title',
    })),
  },
});
```
This will set a default value of "Default Title" for the `title` prop if it's not provided when the component is used.

**Method 2: Using the `props` define option (Nuxt 3 & Vue 3)**

In your Nuxt 3 page or component, define your props with a default value like this:
```javascript
export default {
  props: {
    title: {
      type: String,
      default: 'Default Title',
    },
  },
};
```
Or, if you're using a separate props object:
```javascript
const myProps = {
  title: {
    type: String,
    default: 'Default Title',
  },
};

export default definePage({
  //...
  props: myProps,
});
```
Both of these methods will achieve the same result: setting a default value for the `title` prop.

Note that in Nuxt 3, you can also use the `defineProps` hook to define your props, but the syntax remains similar:
```javascript
export default {
  setup(props) {
    const { title = 'Default Title' } = defineProps(['title']);
    //...
  },
};
```
