**Calculating the Area of a Cube in C++**
====================================================

Below is an example of a function that calculates the surface area and volume of a cube:
```cpp
/**
 * Calculates the surface area and volume of a cube.
 *
 * @param sideLength The length of one side of the cube.
 * @return A pair containing the surface area and volume of the cube.
 */
#include <utility>
double calculateCubeProperties(double sideLength) {
    // Validate input
    if (sideLength <= 0) {
        throw std::invalid_argument("Side length must be greater than zero.");
    }

    // Calculate surface area (6 times the square of the side length)
    double surfaceArea = 6 * pow(sideLength, 2);

    // Return the calculated surface area
    return surfaceArea;
}

int main() {
    try{
        double sideLength;
        std::cout << "Enter the length of one side of the cube:\n" ;
        std::cin >> sideLength;
        double result = calculateCubeProperties(sideLength);
        std::cout << "Surface Area of the Cube: " << result ;
     }
     catch(const std::exception& ex){
           std::cerr<<"Caught exception: "<<ex.what()<< '\n';
     }   
       getchar();

}
```
To use the `calculateCubeProperties` function:

1. Simply call it with the desired value for `sideLength`.
   This should give you the total surface area of your cube.

