{
    auto char_ptr = foo[str_size - 1];
}
```

Below is a simple Python code that acts as a text-based calculator. It allows users to perform basic arithmetic operations like addition, subtraction, multiplication, and division.

```python
def add(x, y):
    """Function to add two numbers"""
    return x + y

def subtract(x, y):
    """Function to subtract two numbers"""
    return x - y

def multiply(x, y):
    """Function to multiply two numbers"""
    return x * y

def divide(x, y):
    """Function to divide two numbers"""
    if y == 0:
        raise ValueError("Cannot divide by zero!")
    else:
        return x / y

while True:
    print("\nSimple Calculator Menu:\n1) Addition\n2) Subtraction\n3) Multiplication\n4) Division\n5) Quit")
    choice = input("Enter your choice (1/2/3/4): ")

    # Check if user wants to quit
    if choice.lower() == "5":
        break

    try:
        num1 = float(input("Enter first number: "))
    except ValueError:
        print("That's not a valid number. Closing the program.")
        break

    operator = None
    if choice in ['1', '2', '3', '4']:
        try:
            num2 = float(input("Enter second number: "))
            if choice == "1":
                result = add(num1, num2)
                operator = '+'
            elif choice == "2":
                result = subtract(num1, num2)
                operator = '-'
            elif choice == "3":
                result = multiply(num1, num2)
                operator = '*'
            elif choice == "4":
                result = divide(num1, num2)
                operator = '/'
        except ValueError as e:
            print(str(e))
            continue

        if operator is not None:
            print(f"{num1} {operator} {num2} = {result}")

    else:
        print("Invalid Input")
```
### Explanation:

- The script begins with defining functions (`add`, `subtract`, `multiply`, `divide`) that take two arguments each.
- In the main part of the code, we have an infinite loop where you are presented with a menu to choose between different operations or to exit.
- Based on your input (1 through 5), you're asked to provide two numbers and then corresponding function is called based on your selection.
- The chosen operation's outcome is printed out as long as everything goes smoothly (meaning inputs are valid).
- If you make any invalid input like characters instead of integers for choices or entering 0 when dividing, you will see appropriate messages to handle these cases gracefully without crashing the application!

