Here is a basic PHP program for an accounting system that includes a General Ledger, Daily Journal, and Income Statement:
```
<?php
// Database configuration
$servername = "localhost";
$username = "root";
$password = "";
$dbname = "accounting_system";

// Create connection
$conn = new mysqli($servername, $username, $password, $dbname);

// Check connection
if ($conn->connect_error) {
    die("Connection failed: ". $conn->connect_error);
}

// Create tables if not exists
$sql = "CREATE TABLE IF NOT EXISTS general_ledger (
  id INT PRIMARY KEY AUTO_INCREMENT,
  account_number VARCHAR(50),
  account_name VARCHAR(255),
  debit DECIMAL(10,2),
  credit DECIMAL(10,2),
  balance DECIMAL(10,2)
)";

$conn->query($sql);

$sql = "CREATE TABLE IF NOT EXISTS daily_journal (
  id INT PRIMARY KEY AUTO_INCREMENT,
  date DATE,
  account_number VARCHAR(50),
  debit DECIMAL(10,2),
  credit DECIMAL(10,2),
  description TEXT
)";
$conn->query($sql);

$sql = "CREATE TABLE IF NOT EXISTS income_statement (
  id INT PRIMARY KEY AUTO_INCREMENT,
  date DATE,
  revenue DECIMAL(10,2),
  expense DECIMAL(10,2),
  net_income DECIMAL(10,2)
)";
$conn->query($sql);

// Functions
function add_transaction($account_number, $debit, $credit, $description){
  global $conn;
  $sql = "INSERT INTO daily_journal (date, account_number, debit, credit, description) VALUES (NOW(), '$account_number', '$debit', '$credit', '$description')";
  if($conn->query($sql)){
    update_general_ledger($account_number, $debit, $credit);
  } else{
    echo "Error adding transaction: ". $conn->error;
  }
}

function update_general_ledger($account_number, $debit, $credit){
  global $conn;
  $sql = "SELECT * FROM general_ledger WHERE account_number = '$account_number'";
  $result = $conn->query($sql);
  if ($result->num_rows > 0) {
    $row = $result->fetch_assoc();
    $new_balance = $row['balance'] + $debit - $credit;
    $sql = "UPDATE general_ledger SET balance = '$new_balance' WHERE account_number = '$account_number'";
    $conn->query($sql);
  } else {
    $sql = "INSERT INTO general_ledger (account_number, account_name, debit, credit, balance) VALUES ('$account_number', 'New Account', '$debit', '$credit', '$debit-$credit')";
    $conn->query($sql);
  }
}

function get_daily_journal() {
  global $conn;
  $sql = "SELECT * FROM daily_journal ORDER BY date ASC";
  $result = $conn->query($sql);
  while($row = $result->fetch_assoc()){
    echo "Date: ". date('M d Y', strtotime($row['date'])). "\n";
    echo "Account Number: ". $row['account_number']. "\n";
    echo "Debit: $". number_format($row['debit'],2). "\n";
    echo "Credit: $". number_format($row['credit'],2). "\n";
    echo "Description: ". $row['description']. "\n\n";
  }
